% Use this one to print sections of the matrices to avoid too many
% continuation lines.
function printFortran(G,name,letter)
sizeG = size(G);
fid = fopen(name,'wt');
for j = 1:sizeG(2)
    fprintf(fid,'      %s(1:%i,%i) = (/\n',letter,sizeG(1),j);
for i = 1:sizeG(1)/2-1
    num1 = num2str(G(2*i-1,j),'%+17.16E');
    num1(20) = 'D';
    num2 = num2str(G(2*i-1,j),'%+17.16E');
    num2(20) = 'D';
    fprintf(fid,'     & %s, %s,\n',num1,num2);
end
    num1 = num2str(G(sizeG(1)-1,j),'%+17.16E');
    num1(20) = 'D';
    num2 = num2str(G(sizeG(1),j),'%+17.16E');
    num2(20) = 'D';
    fprintf(fid,'     & %s, %s\n',num1,num2);
    fprintf(fid,'     &    /)\n');
end
fclose(fid);

function printFortran1(G,name)
sizeG = size(G);
remd = mod(sizeG(1)*sizeG(2),2);
lend = round(sizeG(1)*sizeG(2)/2);
fid = fopen(name,'wt');
for i = 1:lend
    num1 = num2str(G(2*i-1),'%+17.16E');
    num1(20) = 'D';
    num2 = num2str(G(2*i-1),'%+17.16E');
    num2(20) = 'D';
    fprintf(fid,'     & %s, %s,\n',num1,num2);
end
if remd > 0
    num1 = num2str(G(2*i-1),'%+17.16E');
    num1(20) = 'D';
    fprintf(fid,'     & %s\n',num1);
end
fclose(fid);

% This one prints one entry at a time
function printFortran2(G,name,letter)
sizeG = size(G);
fid = fopen(name,'wt');
for j = 1:sizeG(2)
    fprintf(fid,'c      Column %i\n',j);
    for i = 1:sizeG(1)
        num1 = num2str(G(i,j),'%+17.16E');
        num1(20) = 'D';
        fprintf(fid,'      %s(%i,%i) = %s\n',letter,i,j,num1);
    end
end
fclose(fid);